import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

// Polyfill for process (required by simple-peer)
window.process = window.process || { env: {} };

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
